// --- samp_make.FDb._db.LoadTuplesMaybe
// Load all finputs from given directory.
bool samp_make::LoadTuplesMaybe(algo::strptr root, bool recursive) {
    bool retval = true;
    if (FileQ(root)) {
        retval = samp_make::LoadTuplesFile(root, recursive);
    } else if (root == "-") {
        retval = samp_make::LoadTuplesFd(algo::Fildes(0),"(stdin)",recursive);
    } else if (DirectoryQ(root)) {
        retval = retval && samp_make::LoadTuplesFile(algo::SsimFname(root,"sampdb.gitfile"),recursive);
        retval = retval && samp_make::LoadTuplesFile(algo::SsimFname(root,"sampdb.target"),recursive);
        retval = retval && samp_make::LoadTuplesFile(algo::SsimFname(root,"sampdb.targsrc"),recursive);
        retval = retval && samp_make::LoadTuplesFile(algo::SsimFname(root,"sampdb.targrec"),recursive);
        retval = retval && samp_make::LoadTuplesFile(algo::SsimFname(root,"sampdb.targdep"),recursive);
        retval = retval && samp_make::LoadTuplesFile(algo::SsimFname(root,"dmmeta.dispsigcheck"),recursive);
    } else {
        algo_lib::AppendErrtext("path", root);
        algo_lib::AppendErrtext("comment", "Wrong working directory?");
        retval = false;
    }
    return retval;
}

// --- samp_make.FDb._db.LoadTuplesFile
// Load all finputs from given file.
// Read tuples from file FNAME into this namespace's in-memory database.
// If RECURSIVE is TRUE, then also load these tuples into any parent namespaces
// It a file referred to by FNAME is missing, no error is reported (it's considered an empty set).
// Function returns TRUE if all records were parsed and inserted without error.
// If the function returns FALSE, use algo_lib::DetachBadTags() for error description
bool samp_make::LoadTuplesFile(algo::strptr fname, bool recursive) {
    bool retval = true;
    algo_lib::FFildes fildes;
    // missing files are not an error
    fildes.fd = OpenRead(fname,algo::FileFlags());
    if (ValidQ(fildes.fd)) {
        retval = LoadTuplesFd(fildes.fd, fname, recursive);
    }
    return retval;
}

// --- samp_make.FDb._db.LoadTuplesFd
// Load all finputs from given file descriptor.
bool samp_make::LoadTuplesFd(algo::Fildes fd, algo::strptr fname, bool recursive) {
    bool retval = true;
    ind_beg(algo::FileLine_curs,line,fd) {
        if (recursive) {
            retval = retval && algo_lib::InsertStrptrMaybe(line);
        }
        retval = retval && samp_make::InsertStrptrMaybe(line);
        if (!retval) {
            algo_lib::_db.errtext << eol
            << fname << ":"
            << (ind_curs(line).i+1)
            << ": " << line << eol;
            break;
        }
    }ind_end;
    return retval;
}

