// Return pointer to new element, or NULL if insertion failed (due to out-of-memory, duplicate key, etc)
samp_make::FGitfile* samp_make::gitfile_InsertMaybe(const sampdb::Gitfile &value) {
    samp_make::FGitfile *row = &gitfile_Alloc(); // if out of memory, process dies. if input error, return NULL.
    gitfile_CopyIn(*row,const_cast<sampdb::Gitfile&>(value));
    bool ok = gitfile_XrefMaybe(*row); // this may return false
    if (!ok) {
        gitfile_RemoveLast(); // delete offending row, any existing xrefs are cleared
        row = NULL; // forget this ever happened
    }
    return row;
}

// --- samp_make.FDb.gitfile.AllocMem
// Allocate space for one element. If no memory available, return NULL.
void* samp_make::gitfile_AllocMem() {
    u64 new_nelems     = _db.gitfile_n+1;
    // compute level and index on level
    u64 bsr   = algo::u64_BitScanReverse(new_nelems);
    u64 base  = u64(1)<<bsr;
    u64 index = new_nelems-base;
    void *ret = NULL;
    // if level doesn't exist yet, create it
    samp_make::FGitfile*  lev   = NULL;
    if (bsr < 32) {
        lev = _db.gitfile_lary[bsr];
        if (!lev) {
            lev=(samp_make::FGitfile*)algo_lib::malloc_AllocMem(sizeof(samp_make::FGitfile) * (u64(1)<<bsr));
            _db.gitfile_lary[bsr] = lev;
        }
    }
    // allocate element from this level
    if (lev) {
        _db.gitfile_n = i32(new_nelems);
        ret = lev + index;
    }
    return ret;
}

// --- samp_make.FDb.gitfile.RemoveAll
// Remove all elements from Lary
void samp_make::gitfile_RemoveAll() {
    for (u64 n = _db.gitfile_n; n>0; ) {
        n--;
        gitfile_qFind(u64(n)).~FGitfile(); // destroy last element
        _db.gitfile_n = i32(n);
    }
}

// --- samp_make.FDb.gitfile.RemoveLast
// Delete last element of array. Do nothing if array is empty.
void samp_make::gitfile_RemoveLast() {
    u64 n = _db.gitfile_n;
    if (n > 0) {
        n -= 1;
        gitfile_qFind(u64(n)).~FGitfile();
        _db.gitfile_n = i32(n);
    }
}

