// --- samp_make.FDb.ind_gitfile.InsertMaybe
// Insert row into hash table. Return true if row is reachable through the hash after the function completes.
bool samp_make::ind_gitfile_InsertMaybe(samp_make::FGitfile& row) {
    bool retval = true; // if already in hash, InsertMaybe returns true
    if (LIKELY(row.ind_gitfile_next == (samp_make::FGitfile*)-1)) {// check if in hash already
        row.ind_gitfile_hashval = algo::Smallstr50_Hash(0, row.gitfile);
        ind_gitfile_Reserve(1);
        u32 index = row.ind_gitfile_hashval & (_db.ind_gitfile_buckets_n - 1);
        samp_make::FGitfile* *prev = &_db.ind_gitfile_buckets_elems[index];
        do {
            samp_make::FGitfile* ret = *prev;
            if (!ret) { // exit condition 1: reached the end of the list
                break;
            }
            if ((*ret).gitfile == row.gitfile) { // exit condition 2: found matching key
                retval = false;
                break;
            }
            prev = &ret->ind_gitfile_next;
        } while (true);
        if (retval) {
            row.ind_gitfile_next = *prev;
            _db.ind_gitfile_n++;
            *prev = &row;
        }
    }
    return retval;
}

