// --- samp_make.FDb.ind_gitfile.AbsReserve
// Reserve enough room for exacty N elements. Return success code.
void samp_make::ind_gitfile_AbsReserve(int n) {
    u32 old_nbuckets = _db.ind_gitfile_buckets_n;
    u32 new_nelems   = n;
    // # of elements has to be roughly equal to the number of buckets
    if (new_nelems > old_nbuckets) {
        int new_nbuckets = i32_Max(algo::BumpToPow2(new_nelems), u32(4));
        u32 old_size = old_nbuckets * sizeof(samp_make::FGitfile*);
        u32 new_size = new_nbuckets * sizeof(samp_make::FGitfile*);
        // allocate new array. we don't use Realloc since copying is not needed and factor of 2 probably
        // means new memory will have to be allocated anyway
        samp_make::FGitfile* *new_buckets = (samp_make::FGitfile**)algo_lib::malloc_AllocMem(new_size);
        if (UNLIKELY(!new_buckets)) {
            FatalErrorExit("samp_make.out_of_memory  field:samp_make.FDb.ind_gitfile");
        }
        memset(new_buckets, 0, new_size); // clear pointers
        // rehash all entries
        for (int i = 0; i < _db.ind_gitfile_buckets_n; i++) {
            samp_make::FGitfile* elem = _db.ind_gitfile_buckets_elems[i];
            while (elem) {
                samp_make::FGitfile &row        = *elem;
                samp_make::FGitfile* next       = row.ind_gitfile_next;
                u32 index          = row.ind_gitfile_hashval & (new_nbuckets-1);
                row.ind_gitfile_next     = new_buckets[index];
                new_buckets[index] = &row;
                elem               = next;
            }
        }
        // free old array
        algo_lib::malloc_FreeMem(_db.ind_gitfile_buckets_elems, old_size);
        _db.ind_gitfile_buckets_elems = new_buckets;
        _db.ind_gitfile_buckets_n = new_nbuckets;
    }
}

