// --- samp_make.FDb.target.AllocMem
// Allocate space for one element. If no memory available, return NULL.
void* samp_make::target_AllocMem() {
    u64 new_nelems     = _db.target_n+1;
    // compute level and index on level
    u64 bsr   = algo::u64_BitScanReverse(new_nelems);
    u64 base  = u64(1)<<bsr;
    u64 index = new_nelems-base;
    void *ret = NULL;
    // if level doesn't exist yet, create it
    samp_make::FTarget*  lev   = NULL;
    if (bsr < 32) {
        lev = _db.target_lary[bsr];
        if (!lev) {
            lev=(samp_make::FTarget*)algo_lib::malloc_AllocMem(sizeof(samp_make::FTarget) * (u64(1)<<bsr));
            _db.target_lary[bsr] = lev;
        }
    }
    // allocate element from this level
    if (lev) {
        _db.target_n = i32(new_nelems);
        ret = lev + index;
    }
    return ret;
}

// --- samp_make.FDb.target.RemoveAll
// Remove all elements from Lary
void samp_make::target_RemoveAll() {
    for (u64 n = _db.target_n; n>0; ) {
        n--;
        target_qFind(u64(n)).~FTarget(); // destroy last element
        _db.target_n = i32(n);
    }
}

// --- samp_make.FDb.target.RemoveLast
// Delete last element of array. Do nothing if array is empty.
void samp_make::target_RemoveLast() {
    u64 n = _db.target_n;
    if (n > 0) {
        n -= 1;
        target_qFind(u64(n)).~FTarget();
        _db.target_n = i32(n);
    }
}

