// --- samp_make.FDb.ind_target.InsertMaybe
// Insert row into hash table. Return true if row is reachable through the hash after the function completes.
bool samp_make::ind_target_InsertMaybe(samp_make::FTarget& row) {
    bool retval = true; // if already in hash, InsertMaybe returns true
    if (LIKELY(row.ind_target_next == (samp_make::FTarget*)-1)) {// check if in hash already
        row.ind_target_hashval = algo::Smallstr50_Hash(0, row.target);
        ind_target_Reserve(1);
        u32 index = row.ind_target_hashval & (_db.ind_target_buckets_n - 1);
        samp_make::FTarget* *prev = &_db.ind_target_buckets_elems[index];
        do {
            samp_make::FTarget* ret = *prev;
            if (!ret) { // exit condition 1: reached the end of the list
                break;
            }
            if ((*ret).target == row.target) { // exit condition 2: found matching key
                retval = false;
                break;
            }
            prev = &ret->ind_target_next;
        } while (true);
        if (retval) {
            row.ind_target_next = *prev;
            _db.ind_target_n++;
            *prev = &row;
        }
    }
    return retval;
}

