bool samp_make::targdep_XrefMaybe(samp_make::FTargdep &row) {
    bool retval = true;
    (void)row;
    samp_make::FTarget* p_parent = samp_make::ind_target_Find(parent_Get(row));
    if (UNLIKELY(!p_parent)) {
        algo_lib::ResetErrtext() << "samp_make.bad_xref  index:samp_make.FDb.ind_target" << Keyval("key", parent_Get(row));
        return false;
    }
    // targdep: save pointer to parent
    if (true) { // user-defined insert condition
        row.p_parent = p_parent;
    }
    samp_make::FTarget* p_target = samp_make::ind_target_Find(target_Get(row));
    if (UNLIKELY(!p_target)) {
        algo_lib::ResetErrtext() << "samp_make.bad_xref  index:samp_make.FDb.ind_target" << Keyval("key", target_Get(row));
        return false;
    }
    // targdep: save pointer to target
    if (true) { // user-defined insert condition
        row.p_target = p_target;
    }
    // insert targdep into index ind_targdep
    if (true) { // user-defined insert condition
        bool success = ind_targdep_InsertMaybe(row);
        if (UNLIKELY(!success)) {
            ch_RemoveAll(algo_lib::_db.errtext);
            algo_lib::_db.errtext << "samp_make.duplicate_key  xref:samp_make.FDb.ind_targdep"; // check for duplicate key
            return false;
        }
    }
    // insert targdep into index c_targdep
    if (true) { // user-defined insert condition
        c_targdep_Insert(*p_target, row);
    }
    return retval;
}

