// --- samp_make.FDb.ind_targsrc.InsertMaybe
// Insert row into hash table. Return true if row is reachable through the hash after the function completes.
bool samp_make::ind_targsrc_InsertMaybe(samp_make::FTargsrc& row) {
    bool retval = true; // if already in hash, InsertMaybe returns true
    if (LIKELY(row.ind_targsrc_next == (samp_make::FTargsrc*)-1)) {// check if in hash already
        row.ind_targsrc_hashval = algo::Smallstr50_Hash(0, row.targsrc);
        ind_targsrc_Reserve(1);
        u32 index = row.ind_targsrc_hashval & (_db.ind_targsrc_buckets_n - 1);
        samp_make::FTargsrc* *prev = &_db.ind_targsrc_buckets_elems[index];
        do {
            samp_make::FTargsrc* ret = *prev;
            if (!ret) { // exit condition 1: reached the end of the list
                break;
            }
            if ((*ret).targsrc == row.targsrc) { // exit condition 2: found matching key
                retval = false;
                break;
            }
            prev = &ret->ind_targsrc_next;
        } while (true);
        if (retval) {
            row.ind_targsrc_next = *prev;
            _db.ind_targsrc_n++;
            *prev = &row;
        }
    }
    return retval;
}

// --- samp_make.FDb.ind_targsrc.Remove
// Remove reference to element from hash index. If element is not in hash, do nothing
void samp_make::ind_targsrc_Remove(samp_make::FTargsrc& row) {
    if (LIKELY(row.ind_targsrc_next != (samp_make::FTargsrc*)-1)) {// check if in hash already
        u32 index = row.ind_targsrc_hashval & (_db.ind_targsrc_buckets_n - 1);
        samp_make::FTargsrc* *prev = &_db.ind_targsrc_buckets_elems[index]; // addr of pointer to current element
        while (samp_make::FTargsrc *next = *prev) {                          // scan the collision chain for our element
            if (next == &row) {        // found it?
                *prev = next->ind_targsrc_next; // unlink (singly linked list)
                _db.ind_targsrc_n--;
                row.ind_targsrc_next = (samp_make::FTargsrc*)-1;// not-in-hash
                break;
            }
            prev = &next->ind_targsrc_next;
        }
    }
}

// --- samp_make.FDb.ind_targsrc.Reserve
// Reserve enough room in the hash for N more elements. Return success code.
void samp_make::ind_targsrc_Reserve(int n) {
    ind_targsrc_AbsReserve(_db.ind_targsrc_n + n);
}

// --- samp_make.FDb.ind_targsrc.AbsReserve
// Reserve enough room for exacty N elements. Return success code.
void samp_make::ind_targsrc_AbsReserve(int n) {
    u32 old_nbuckets = _db.ind_targsrc_buckets_n;
    u32 new_nelems   = n;
    // # of elements has to be roughly equal to the number of buckets
    if (new_nelems > old_nbuckets) {
        int new_nbuckets = i32_Max(algo::BumpToPow2(new_nelems), u32(4));
        u32 old_size = old_nbuckets * sizeof(samp_make::FTargsrc*);
        u32 new_size = new_nbuckets * sizeof(samp_make::FTargsrc*);
        // allocate new array. we don't use Realloc since copying is not needed and factor of 2 probably
        // means new memory will have to be allocated anyway
        samp_make::FTargsrc* *new_buckets = (samp_make::FTargsrc**)algo_lib::malloc_AllocMem(new_size);
        if (UNLIKELY(!new_buckets)) {
            FatalErrorExit("samp_make.out_of_memory  field:samp_make.FDb.ind_targsrc");
        }
        memset(new_buckets, 0, new_size); // clear pointers
        // rehash all entries
        for (int i = 0; i < _db.ind_targsrc_buckets_n; i++) {
            samp_make::FTargsrc* elem = _db.ind_targsrc_buckets_elems[i];
            while (elem) {
                samp_make::FTargsrc &row        = *elem;
                samp_make::FTargsrc* next       = row.ind_targsrc_next;
                u32 index          = row.ind_targsrc_hashval & (new_nbuckets-1);
                row.ind_targsrc_next     = new_buckets[index];
                new_buckets[index] = &row;
                elem               = next;
            }
        }
        // free old array
        algo_lib::malloc_FreeMem(_db.ind_targsrc_buckets_elems, old_size);
        _db.ind_targsrc_buckets_elems = new_buckets;
        _db.ind_targsrc_buckets_n = new_nbuckets;
    }
}

