// --- samp_make.FieldId.value.ToCstr
// Convert numeric value of field to one of predefined string constants.
// If string is found, return a static C string. Otherwise, return NULL.
const char* samp_make::value_ToCstr(const samp_make::FieldId& parent) {
    const char *ret = NULL;
    switch(value_GetEnum(parent)) {
        case samp_make_FieldId_value       : ret = "value";  break;
    }
    return ret;
}

// --- samp_make.FieldId.value.Print
// Convert value to a string. First, attempt conversion to a known string.
// If no string matches, print value as a numeric value.
void samp_make::value_Print(const samp_make::FieldId& parent, algo::cstring &lhs) {
    const char *strval = value_ToCstr(parent);
    if (strval) {
        lhs << strval;
    } else {
        lhs << parent.value;
    }
}

// --- samp_make.FieldId.value.SetStrptrMaybe
// Convert string to field.
// If the string is invalid, do not modify field and return false.
// In case of success, return true
bool samp_make::value_SetStrptrMaybe(samp_make::FieldId& parent, algo::strptr rhs) {
    bool ret = false;
    switch (elems_N(rhs)) {
        case 5: {
            switch (u64(algo::ReadLE32(rhs.elems))|(u64(rhs[4])<<32)) {
                case LE_STR5('v','a','l','u','e'): {
                    value_SetEnum(parent,samp_make_FieldId_value); ret = true; break;
                }
            }
            break;
        }
    }
    return ret;
}

// --- samp_make.FieldId.value.SetStrptr
// Convert string to field.
// If the string is invalid, set numeric value to DFLT
void samp_make::value_SetStrptr(samp_make::FieldId& parent, algo::strptr rhs, samp_make_FieldIdEnum dflt) {
    if (!value_SetStrptrMaybe(parent,rhs)) value_SetEnum(parent,dflt);
}

// --- samp_make.FieldId.value.ReadStrptrMaybe
// Convert string to field. Return success value
bool samp_make::value_ReadStrptrMaybe(samp_make::FieldId& parent, algo::strptr rhs) {
    bool retval = false;
    retval = value_SetStrptrMaybe(parent,rhs); // try symbol conversion
    if (!retval) { // didn't work? try reading as underlying type
        retval = i32_ReadStrptrMaybe(parent.value,rhs);
    }
    return retval;
}

// --- samp_make.FieldId..ReadStrptrMaybe
// Read fields of samp_make::FieldId from an ascii string.
// The format of the string is the format of the samp_make::FieldId's only field
bool samp_make::FieldId_ReadStrptrMaybe(samp_make::FieldId &parent, algo::strptr in_str) {
    bool retval = true;
    retval = retval && value_ReadStrptrMaybe(parent, in_str);
    return retval;
}

