// --- samp_make.TableId.value.ToCstr
// Convert numeric value of field to one of predefined string constants.
// If string is found, return a static C string. Otherwise, return NULL.
const char* samp_make::value_ToCstr(const samp_make::TableId& parent) {
    const char *ret = NULL;
    switch(value_GetEnum(parent)) {
        case samp_make_TableId_sampdb_Gitfile: ret = "sampdb.Gitfile";  break;
        case samp_make_TableId_sampdb_Targdep: ret = "sampdb.Targdep";  break;
        case samp_make_TableId_sampdb_Target: ret = "sampdb.Target";  break;
        case samp_make_TableId_sampdb_Targrec: ret = "sampdb.Targrec";  break;
        case samp_make_TableId_sampdb_Targsrc: ret = "sampdb.Targsrc";  break;
    }
    return ret;
}

// --- samp_make.TableId.value.Print
// Convert value to a string. First, attempt conversion to a known string.
// If no string matches, print value as a numeric value.
void samp_make::value_Print(const samp_make::TableId& parent, algo::cstring &lhs) {
    const char *strval = value_ToCstr(parent);
    if (strval) {
        lhs << strval;
    } else {
        lhs << parent.value;
    }
}

// --- samp_make.TableId.value.SetStrptrMaybe
// Convert string to field.
// If the string is invalid, do not modify field and return false.
// In case of success, return true
bool samp_make::value_SetStrptrMaybe(samp_make::TableId& parent, algo::strptr rhs) {
    bool ret = false;
    switch (elems_N(rhs)) {
        case 13: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('s','a','m','p','d','b','.','T'): {
                    if (memcmp(rhs.elems+8,"arget",5)==0) { value_SetEnum(parent,samp_make_TableId_sampdb_Target); ret = true; break; }
                    break;
                }
                case LE_STR8('s','a','m','p','d','b','.','t'): {
                    if (memcmp(rhs.elems+8,"arget",5)==0) { value_SetEnum(parent,samp_make_TableId_sampdb_target); ret = true; break; }
                    break;
                }
            }
            break;
        }
        case 14: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('s','a','m','p','d','b','.','G'): {
                    if (memcmp(rhs.elems+8,"itfile",6)==0) { value_SetEnum(parent,samp_make_TableId_sampdb_Gitfile); ret = true; break; }
                    break;
                }
                case LE_STR8('s','a','m','p','d','b','.','T'): {
                    if (memcmp(rhs.elems+8,"argdep",6)==0) { value_SetEnum(parent,samp_make_TableId_sampdb_Targdep); ret = true; break; }
                    if (memcmp(rhs.elems+8,"argrec",6)==0) { value_SetEnum(parent,samp_make_TableId_sampdb_Targrec); ret = true; break; }
                    if (memcmp(rhs.elems+8,"argsrc",6)==0) { value_SetEnum(parent,samp_make_TableId_sampdb_Targsrc); ret = true; break; }
                    break;
                }
                case LE_STR8('s','a','m','p','d','b','.','g'): {
                    if (memcmp(rhs.elems+8,"itfile",6)==0) { value_SetEnum(parent,samp_make_TableId_sampdb_gitfile); ret = true; break; }
                    break;
                }
                case LE_STR8('s','a','m','p','d','b','.','t'): {
                    if (memcmp(rhs.elems+8,"argdep",6)==0) { value_SetEnum(parent,samp_make_TableId_sampdb_targdep); ret = true; break; }
                    if (memcmp(rhs.elems+8,"argrec",6)==0) { value_SetEnum(parent,samp_make_TableId_sampdb_targrec); ret = true; break; }
                    if (memcmp(rhs.elems+8,"argsrc",6)==0) { value_SetEnum(parent,samp_make_TableId_sampdb_targsrc); ret = true; break; }
                    break;
                }
            }
            break;
        }
    }
    return ret;
}

// --- samp_make.TableId.value.SetStrptr
// Convert string to field.
// If the string is invalid, set numeric value to DFLT
void samp_make::value_SetStrptr(samp_make::TableId& parent, algo::strptr rhs, samp_make_TableIdEnum dflt) {
    if (!value_SetStrptrMaybe(parent,rhs)) value_SetEnum(parent,dflt);
}

// --- samp_make.TableId.value.ReadStrptrMaybe
// Convert string to field. Return success value
bool samp_make::value_ReadStrptrMaybe(samp_make::TableId& parent, algo::strptr rhs) {
    bool retval = false;
    retval = value_SetStrptrMaybe(parent,rhs); // try symbol conversion
    if (!retval) { // didn't work? try reading as underlying type
        retval = i32_ReadStrptrMaybe(parent.value,rhs);
    }
    return retval;
}

// --- samp_make.TableId..ReadStrptrMaybe
// Read fields of samp_make::TableId from an ascii string.
// The format of the string is the format of the samp_make::TableId's only field
bool samp_make::TableId_ReadStrptrMaybe(samp_make::TableId &parent, algo::strptr in_str) {
    bool retval = true;
    retval = retval && value_ReadStrptrMaybe(parent, in_str);
    return retval;
}

